plugin-presence.users-subheading:
sub-heading for the previous message ('# User(s)'), so that together they form a sentence. E.g. '1 User', 'currently viewing this document'.

Thus in German this would be
<pre>
{count, plural,
  one {betrachtet derzeit dieses Dokument}
other {betrachten derzeit dieses Dokument}
}
</pre>
